import React, {useState} from 'react';

import AddUser from './components/Users/AddUser';
import UsersList from './components/Users/UsersList';

function App() {
  const [userlist, setUserlist] = useState([
    {user: "Max", age:"20"},
    {user: "Maxi", age: "18"}
  ]);
  return (
    <div>
      <AddUser />
      <UsersList user={userlist}/>
    </div>
  );
}

export default App;
